Continue in our study through the heavenly scene in REVELATION 15. We read of those saved around the throne, worshipping the Lord God Almighty, and the temple filled with the glory of God. At this time, we are introduced to the seven bowls of wrath. Gain a Biblical understanding of the wrath of God, and consider what the seven bowls of wrath imply for your life today. May we be set apart, wholly and heartily unto the Lord, Jesus Christ.
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
